The movie begins with the aging Brushy Bill Roberts narrating his story to a young historian. His claim? He claims that he is the famous outlaw William H. Bonney, alias Billy the Kid, who was supposedly shot and killed by Patrick Floyd Garrett in 1881. The old man gives a very convincing story on how he and Garrett, along with Arkansas Dave Rudabaugh, Chavez y Chavez, Doc Skurlock, and a few others led the outlaw life and avoided the law, as they were wanted men. Garrett, a friend of Billy&amp;#039;s, was paid by John Chisum, a cattle king, to eliminate Billy the Kid. So, Garrett and Ashmun Upson set out on a journey to find Billy the Kid. Written by David Landers {&lt;a class=&quot;__cf_email__&quot; href=&quot;/cdn-cgi/l/email-protection&quot; data-cfemail=&quot;e0848d8ca087978993ce838f8d&quot;&gt;[email&amp;#160;protected]&lt;/a&gt;&lt;script cf-hash='f9e31' type=&quot;text/javascript&quot;&gt;
